// import { useState } from "react";
import "./companiesCategory.css"
const airLineCompanies = ["Победа", "Red Wings", "S7 Airlines"];

const CompaniesCategory = () => {
  // const [companies, setCompanies] = useState([]);
  return (
    <div className="category">
      <div className="category__info">Компании</div>
      <ul className="category__list">
        {airLineCompanies.map((item, index) => (
          <li
            className="category__list__wrapper"
            key={index}
            
          >
            <button className="category__list__button__companies">
              {/* <img
                src={category.includes(index) ? CheakMark : Nothing}
                alt="true"
              /> */}
            </button>
            <div className="category__list__item">{item}</div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CompaniesCategory;
